    path: "/guide.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/rzr/Desktop/学习/rzrVuepress/docs/guide.md").then(comp => {
        Vue.component("v-72cd3cf044184", comp.default)
        next()
      })
    }
  },
  {
